import React from 'react';

export default class List extends React.Component {
  render() {
    return (
      <div className='h6'>
        <h6>
          <b>{this.props.name}</b>
        </h6>
        <div className='btn'>
          <span>
            <i class='far fa-trash-alt'></i>
          </span>
          <span>
            <i class='far fa-check-square'></i>
          </span>
        </div>
      </div>
    );
  }
}
